import React, { Component }  from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component{
  constructor() {
    super();
    this.state = {
      monsters:[
        {
          name: 'Frankenstein'
        },
        {
          name: 'Dracula'
        },
        {
          name: 'Wolf'
        },
      ],
      mans:[
        {
          name: 'ezio'
        },
        {
          name: 'jack'
        },
        {
          name: 'hellboy'
        },
      ]
    }


  }

  render() {
    return(
      <div className="App">
      {
        this.state.monsters.map( monster => <h1>{ monster.name} </h1>)
      },
      {
        this.state.mans.map( man => <h1>{ man.name} </h1>)
      }
    </div>
    );
  }

}


export default App;
